const evalRPN = `
const evalRPN = function (tokens) {
  const stack = []
  const isOperator = token => token === '+' || token === '-' || token === '*' || token === '/'
  for (const token of tokens) {
    if (isOperator(token)) {
      const b = stack.pop()
      const a = stack.pop()
      let result = 0
      switch (token) {
        case '+':
          result = a + b
          break
        case '-':
          result = a - b
